INSERT INTO `courses` VALUES (1,0,0,'Clínica','e²','Evangelismo Eficaz',NULL,'A Clínica de Evangelismo Eficaz é destinada a pastores, líderes e membros da igreja local que desejam ser treinados para viver e compartilhar o evangelho de forma bíblica, intencional e multiplicadora no dia a dia.','https://beta.eebrasil.org.br/ministry/everyday-evangelism',NULL,NULL,'A Clínica de Evangelismo Explosivo capacita a igreja local a viver o evangelismo como estilo de vida, fortalecendo amizades intencionais, promovendo o evangelismo pessoal, estruturando o discipulado com acompanhamento e conduzindo a um crescimento saudável, no qual cada crente é preparado para testemunhar com fidelidade bíblica e compromisso com a Grande Comissão.',NULL,NULL,NULL,180.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',1),(2,1,1,'Workshop','ESM','Evangelho Em Sua Mão',NULL,'A Implementação do Evangelismo Eficaz é destinada a membros da igreja local que desejam ser treinados para viver e compartilhar o evangelho de forma bíblica, intencional e multiplicadora no dia a dia.','https://beta.eebrasil.org.br/ministry/everyday-evangelism',NULL,NULL,NULL,NULL,NULL,NULL,65.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',1),(3,2,1,'implementation','e²','Explicar o Evangelho',NULL,'A Implementação do Evangelismo Eficaz é destinada a membros da igreja local que desejam ser treinados para viver e compartilhar o evangelho de forma bíblica, intencional e multiplicadora no dia a dia.','https://beta.eebrasil.org.br/ministry/everyday-evangelism',NULL,NULL,NULL,NULL,NULL,NULL,22.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',1),(4,3,1,'implementation','m²','Mentorear para Multiplicar',NULL,'A Implementação do Evangelismo Eficaz é destinada a membros da igreja local que desejam ser treinados para viver e compartilhar o evangelho de forma bíblica, intencional e multiplicadora no dia a dia.','https://beta.eebrasil.org.br/ministry/everyday-evangelism',NULL,NULL,NULL,NULL,NULL,NULL,18.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',1),(5,4,1,'implementation','c²','Crescer em Cristo',NULL,'A Implementação do Evangelismo Eficaz é destinada a membros da igreja local que desejam ser treinados para viver e compartilhar o evangelho de forma bíblica, intencional e multiplicadora no dia a dia.','https://beta.eebrasil.org.br/ministry/everyday-evangelism',NULL,NULL,NULL,NULL,NULL,NULL,18.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',1),(6,5,1,'implementation','r²','Responder com a Razão',NULL,'A Implementação do Evangelismo Eficaz é destinada a membros da igreja local que desejam ser treinados para viver e compartilhar o evangelho de forma bíblica, intencional e multiplicadora no dia a dia.','https://beta.eebrasil.org.br/ministry/everyday-evangelism',NULL,NULL,NULL,NULL,NULL,NULL,18.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',1),(7,0,0,'Workshop','EPC','Esperança Para Crianças',NULL,'O Workshop Hope for Kids (EE-Kids) é destinado a professores, líderes de ministério infantil, pais e voluntários que desejam ser capacitados para apresentar o evangelho às crianças de forma bíblica, clara e adequada à sua faixa etária.','https://beta.eebrasil.org.br/ministry/kids-ee',NULL,NULL,'O EE-Kids, por meio da ferramenta Esperança Para Crianças, capacita a igreja local a apresentar o evangelho de Cristo às crianças de forma clara, bíblica e apropriada à sua idade, envolvendo família e comunidade no processo. Com metodologia simples e fiel às Escrituras, o ministério forma líderes e voluntários para comunicar a mensagem da salvação, cultivar valores cristãos e estabelecer fundamentos de discipulado desde cedo, cooperando para o crescimento saudável da igreja. Em suma: sem atalhos, sem modismos, o bom e antigo evangelho, semeado nos corações pequenos para frutos eternos.',NULL,NULL,NULL,50.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',2),(8,1,1,'implementation','EPC','Esperança Para Crianças',NULL,'O Workshop Hope for Kids (EE-Kids) é destinado a professores, líderes de ministério infantil, pais e voluntários que desejam ser capacitados para apresentar o evangelho às crianças de forma bíblica, clara e adequada à sua faixa etária.','https://beta.eebrasil.org.br/ministry/kids-ee',NULL,NULL,NULL,NULL,NULL,NULL,10.00,0,'2026-02-25 21:09:08','2026-02-25 21:09:08',2);
