INSERT INTO `sections` VALUES (1,'Unidade 1: Por Que Estamos Aqui?',NULL,1,'35 min',NULL,'Esta unidade estabelece o propósito do workshop: recuperar o senso de chamado para compartilhar a fé e formar discípulos, não apenas convertidos. Trabalha motivações, expectativas e fundamentos bíblicos para que o evangelismo volte a ser um estilo de vida, como na igreja primitiva.',NULL,NULL,NULL,1),(2,'Unidade 2: Aprendendo a Explicação do Evangelho Em Sua Mão',NULL,2,'25 min',NULL,'Esta unidade ensina uma ferramenta prática e memorável para apresentar o Evangelho usando a própria mão, tornando a explicação simples, natural e fácil de reproduzir. O foco é capacitar o aluno a comunicar com clareza e segurança.',NULL,NULL,NULL,1),(3,'Unidade 3: Vencendo o Medo de Testemunhar',NULL,3,'35 min',NULL,'Esta unidade confronta o medo como uma das maiores barreiras ao testemunho cristão. O participante aprende a substituir insegurança por dependência do Espírito Santo, entendendo que evangelizar é um ato de obediência, não de habilidade pessoal.',NULL,NULL,NULL,1),(4,'Unidade 4: Encontrando Pessoas Receptivas',NULL,4,'35 min',NULL,'Ensina como discernir abertura espiritual e conduzir conversas significativas, identificando oportunidades naturais para apresentar o Evangelho com respeito, sensibilidade e intencionalidade.',NULL,NULL,NULL,1),(5,'Unidade 5: Compartilhando o Evangelho Através de Ilustrações',NULL,5,'30 min',NULL,'Apresenta o uso de ilustrações como recurso pedagógico para comunicar verdades espirituais de forma clara e memorável, facilitando a compreensão do Evangelho sem comprometer sua fidelidade bíblica.',NULL,NULL,NULL,1),(6,'Unidade 6: Levando a Uma Decisão',NULL,6,'20 min',NULL,'Orienta como conduzir o ouvinte a uma resposta consciente ao Evangelho, explicando arrependimento e fé, lidando com dúvidas comuns e respeitando o tempo e a consciência da pessoa.',NULL,NULL,NULL,1),(7,'Unidade 7: Desenvolvendo Amor pelos Perdidos',NULL,7,'20 min',NULL,'Trabalha o aspecto do coração do evangelista, despertando compaixão, sensibilidade espiritual e urgência missionária, para que o evangelismo flua do amor e não apenas da técnica.',NULL,NULL,NULL,1),(8,'Unidade 8: Desenvolvendo um Ministério Contínuo de Evangelismo e Discipulado',NULL,8,'20 min',NULL,'Apresenta princípios para estruturar um ministério permanente de evangelismo e discipulado na igreja local, integrando treinamento, prática e acompanhamento espiritual.',NULL,NULL,NULL,1),(9,'Encerramento: Juntos na Colheita do Senhor',NULL,9,'30 min',NULL,'Sessão final que reforça o compromisso com a missão, chamando os participantes a permanecerem ativos na colheita espiritual, unidos em oração, ação e visão de multiplicação.',NULL,NULL,NULL,1),(10,'Orientações da Clínica de Evangelismo Explosivo',NULL,10,'10 min',NULL,'Esta unidade apresenta a visão, o propósito e a base histórica da Clínica de Evangelismo Explosivo, destacando seu papel no cumprimento da Grande Comissão. O conteúdo enfatiza o compromisso espiritual, a unidade do Corpo de Cristo e a responsabilidade do participante em viver e multiplicar o evangelismo como estilo de vida.',NULL,NULL,NULL,1),(11,'O Treinamento de e² — Evangelismo Eficaz',NULL,11,'20 min',NULL,'Nesta unidade o facilitador compreende a proposta pedagógica do treinamento e², fundamentada na aprendizagem autêntica. O conteúdo apresenta a transição do modelo tradicional de ensino para um formato relacional, prático e participativo, preparando líderes para formar discípulos que aprendem fazendo.',NULL,NULL,NULL,1),(12,'Elementos-Chave do Treinamento e²',NULL,12,'40 min',NULL,'Esta unidade detalha os princípios essenciais que sustentam o treinamento e², incluindo o papel do facilitador, mentores, companheiros de oração, dinâmica em pequenos grupos, uso correto das ilustrações e a integração entre relacionamento e proclamação do Evangelho.',NULL,NULL,NULL,1),(13,'O Ensino Semanal no e²',NULL,13,'30 min','Devocional Semanal','Esta unidade orienta o facilitador quanto à condução das aulas semanais do e², apresentando a estrutura pedagógica baseada em devocional, revisão, prática e conversa. O foco está no desenvolvimento espiritual contínuo e na participação ativa dos alunos no processo de aprendizagem.',NULL,NULL,NULL,1),(14,'AULA: Saídas de Treinamento Prático (STP)',NULL,14,'45 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(15,'Uso do Questionário de Segurança',NULL,15,'20 min',NULL,'Nesta unidade o facilitador aprende o propósito e a aplicação do questionário de segurança como ferramenta evangelística. O conteúdo orienta sobre abordagem respeitosa, identificação de pessoas receptivas e condução sábia de conversas espirituais em ambientes públicos e residenciais.',NULL,NULL,NULL,1),(16,'ORIENTAÇÕES PARA PRÁTICA 1: Saídas de Treinamento Prático (STP)',NULL,16,'10 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(17,'PRÁTICA 1: Saídas de Treinamento Prático (STP)',NULL,17,'60 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(18,'Relatório Público',NULL,18,'30 min',NULL,'Esta unidade ensina a condução dos relatórios públicos após as Saídas de Treinamento Prático. O objetivo é promover encorajamento, aprendizado coletivo e intercessão, fortalecendo o senso de unidade e celebração da obra que Deus está realizando.',NULL,NULL,NULL,1),(19,'PRÁTICA 1: Relatório Público',NULL,19,'30 min',NULL,'Esta unidade ensina a condução dos relatórios públicos após as Saídas de Treinamento Prático. O objetivo é promover encorajamento, aprendizado coletivo e intercessão, fortalecendo o senso de unidade e celebração da obra que Deus está realizando.',NULL,NULL,NULL,1),(20,'Unidade 1 — Conectando',NULL,20,'60 min','Conectando-se às Pessoas','Esta unidade desenvolve a habilidade de criar relacionamentos intencionais que conduzem naturalmente ao diálogo espiritual. O aluno aprende a ouvir com atenção, fazer perguntas apropriadas e identificar pessoas receptivas, seguindo o exemplo de Jesus ao se conectar genuinamente com as pessoas.',NULL,NULL,NULL,1),(21,'Unidade 2 — O Evangelho: Graça',NULL,21,'35 min','A Graça de Deus','Nesta unidade o aluno compreende que a vida eterna é um presente de Deus, não conquistado por méritos ou boas obras. O conteúdo enfatiza o contraste entre o caminho humano e o caminho divino, estabelecendo a graça como fundamento central do Evangelho.',NULL,NULL,NULL,1),(22,'Unidade 3 — O Evangelho: Homem',NULL,22,'35 min','A Condição do Homem','Esta unidade apresenta a realidade do pecado e a incapacidade humana de alcançar o padrão de perfeição exigido por Deus. O aluno aprende a explicar com clareza a condição espiritual do homem e sua necessidade absoluta de salvação.',NULL,NULL,NULL,1),(23,'ORIENTAÇÕES PARA PRÁTICA 2: Saídas de Treinamento Prático (STP)',NULL,23,'10 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(24,'PRÁTICA 2: Saídas de Treinamento Prático (STP)',NULL,24,'90 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(25,'PRÁTICA 2: Relatório Público',NULL,25,'30 min',NULL,'Esta unidade ensina a condução dos relatórios públicos após as Saídas de Treinamento Prático. O objetivo é promover encorajamento, aprendizado coletivo e intercessão, fortalecendo o senso de unidade e celebração da obra que Deus está realizando.',NULL,NULL,NULL,1),(26,'Unidade 4 — Compartilhando Seu Testemunho',NULL,26,'35 min','O Poder de Seu Testemunho','Nesta unidade o aluno aprende a preparar e compartilhar seu testemunho pessoal de forma clara, objetiva e centrada na obra de Deus. O testemunho é apresentado como ponte relacional que desperta interesse espiritual e prepara o coração para o Evangelho.',NULL,NULL,NULL,1),(27,'Unidade 5 — O Evangelho: Deus e Cristo',NULL,27,'35 min','Deus e Jesus Cristo','Esta unidade aprofunda o entendimento sobre a natureza de Deus como amoroso e justo, e apresenta Jesus Cristo como o Deus-homem. O aluno aprende a explicar a obra substitutiva de Cristo na cruz como solução definitiva para o problema do pecado.',NULL,NULL,NULL,1),(28,'Unidade 6 — O Evangelho: Fé',NULL,28,'35 min','Entendendo a Fé','Nesta unidade o aluno distingue fé salvadora de fé temporal ou mero conhecimento intelectual. O conteúdo ensina que a salvação ocorre quando a confiança é transferida totalmente para Jesus Cristo, e não para esforços humanos.',NULL,NULL,NULL,1),(29,'Unidade 7 — Decisão e Acompanhamento',NULL,29,'35 min','O Amor de Deus pelos Perdidos','A unidade final ensina como conduzir uma pessoa à decisão por Cristo e como oferecer acompanhamento espiritual adequado. O foco está em apresentar o convite com clareza, respeito e amor, garantindo segurança de salvação e cuidado com o novo convertido.',NULL,NULL,NULL,1),(30,'Guia de Implementação do Ministério de Evangelismo Explosivo',NULL,30,'60 min',NULL,'Esta unidade capacita o facilitador a implementar o ministério de Evangelismo Explosivo na igreja local. O conteúdo apresenta princípios de visão, planejamento, organização, formação de líderes e acompanhamento espiritual, visando a multiplicação saudável do ministério.',NULL,NULL,NULL,1),(31,'ORIENTAÇÕES PARA PRÁTICA 3: Saídas de Treinamento Prático (STP)',NULL,31,'10 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(32,'PRÁTICA 3: Saídas de Treinamento Prático (STP)',NULL,32,'80 min',NULL,'Esta unidade aborda a importância das Saídas de Treinamento Prático como elemento central do aprendizado. O conteúdo ensina como planejar, organizar e conduzir visitas evangelísticas, promovendo experiências reais que fortalecem a confiança e a maturidade espiritual dos participantes.',NULL,NULL,NULL,1),(33,'PRÁTICA 3: Relatório Público',NULL,33,'30 min',NULL,'Esta unidade ensina a condução dos relatórios públicos após as Saídas de Treinamento Prático. O objetivo é promover encorajamento, aprendizado coletivo e intercessão, fortalecendo o senso de unidade e celebração da obra que Deus está realizando.',NULL,NULL,NULL,1),(34,'Unidade 1 — Por Que Estamos Aqui?',NULL,1,'45 min',NULL,'Esta unidade estabelece o propósito do workshop: recuperar o senso de chamado para compartilhar a fé e formar discípulos, não apenas convertidos. Trabalha motivações, expectativas e fundamentos bíblicos para que o evangelismo volte a ser um estilo de vida, como na igreja primitiva.',NULL,NULL,NULL,2),(35,'Unidade 2 — Aprendendo a Explicação do Evangelho Em Sua Mão',NULL,2,'20 min',NULL,'Esta unidade ensina uma ferramenta prática e memorável para apresentar o Evangelho usando a p