orça o compromisso com a missão, chamando os participantes a permanecerem ativos na colheita espiritual, unidos em oração, ação e visão de multiplicação.',NULL,NULL,NULL,2),(43,'Unidade 1 — Conectando',NULL,1,'60 min','Conectando-se às Pessoas','Esta unidade desenvolve a habilidade de criar relacionamentos intencionais que conduzem naturalmente ao diálogo espiritual. O aluno aprende a ouvir com atenção, fazer perguntas apropriadas e identificar pessoas receptivas, seguindo o exemplo de Jesus ao se conectar genuinamente com as pessoas.',NULL,NULL,NULL,3),(44,'Unidade 2 — O Evangelho: Graça',NULL,2,'60 min','A Graça de Deus','Nesta unidade o aluno compreende que a vida eterna é um presente de Deus, não conquistado por méritos ou boas obras. O conteúdo enfatiza o contraste entre o caminho humano e o caminho divino, estabelecendo a graça como fundamento central do Evangelho.',NULL,NULL,NULL,3),(45,'Unidade 3 — O Evangelho: Homem',NULL,3,'60 min','A Condição do Homem','Esta unidade apresenta a realidade do pecado e a incapacidade humana de alcançar o padrão de perfeição exigido por Deus. O aluno aprende a explicar com clareza a condição espiritual do homem e sua necessidade absoluta de salvação.',NULL,NULL,NULL,3),(46,'Unidade 4 — Compartilhando Seu Testemunho',NULL,4,'60 min','O Poder de Seu Testemunho','Nesta unidade o aluno aprende a preparar e compartilhar seu testemunho pessoal de forma clara, objetiva e centrada na obra de Deus. O testemunho é apresentado como ponte relacional que desperta interesse espiritual e prepara o coração para o Evangelho.',NULL,NULL,NULL,3),(47,'Unidade 5 — O Evangelho: Deus e Cristo',NULL,5,'60 min','Deus e Jesus Cristo','Esta unidade aprofunda o entendimento sobre a natureza de Deus como amoroso e justo, e apresenta Jesus Cristo como o Deus-homem. O aluno aprende a explicar a obra substitutiva de Cristo na cruz como solução definitiva para o problema do pecado.',NULL,NULL,NULL,3),(48,'Unidade 6 — O Evangelho: Fé',NULL,6,'60 min','Entendendo a Fé','Nesta unidade o aluno distingue fé salvadora de fé temporal ou mero conhecimento intelectual. O conteúdo ensina que a salvação ocorre quando a confiança é transferida totalmente para Jesus Cristo, e não para esforços humanos.',NULL,NULL,NULL,3),(49,'Unidade 7 — Decisão e Acompanhamento',NULL,7,'60 min','O Amor de Deus pelos Perdidos','A unidade final ensina como conduzir uma pessoa à decisão por Cristo e como oferecer acompanhamento espiritual adequado. O foco está em apresentar o convite com clareza, respeito e amor, garantindo segurança de salvação e cuidado com o novo convertido.',NULL,NULL,NULL,3),(50,'Unidade 1 — A Formação de um Mentor',NULL,1,'60 min','Devocional 1 — Poder do Alto','Esta unidade introduz o papel do mentor como alguém que lidera pelo exemplo e forma discípulos com visão de multiplicação. O aluno aprende que mentorear envolve oração, demonstração, delegação e prática intencional, preparando-se para guiar novos discípulos na explicação do Evangelho e no desenvolvimento de hábitos espirituais consistentes.',NULL,NULL,NULL,4),(51,'Unidade 2 — O Método de um Mentor',NULL,2,'60 min','Devocional 2 — Jesus como Mentor','Esta unidade apresenta o método de mentoreamento centrado em treinamento prático e acompanhamento relacional. O conteúdo enfatiza a Saída de Treinamento Prático como ferramenta principal para formar discípulos que aprendem observando, participando e recebendo feedback, sempre com responsabilidade e sensibilidade à direção de Deus.',NULL,NULL,NULL,4),(52,'Unidade 3 — O Modelo de um Mentor',NULL,3,'60 min','Devocional 3 — Encontros Marcados por Deus','Nesta unidade, o aluno é levado a enxergar o evangelismo como cooperação com a obra de Deus, aprendendo a identificar oportunidades preparadas pelo Senhor. O foco está em conexão genuína com as pessoas, boas transições na conversa e uso responsável de perguntas diagnósticas, evitando manipulação e buscando receptividade real.',NULL,NULL,NULL,4),(53,'Unidade 4 — A Mensagem de um Mentor',NULL,4,'60 min','Devocional 4 — A Arte de Contar Histórias','Esta unidade treina o mentor a comunicar verdades espirituais com clareza e impacto, usando histórias e experiências com Deus de forma apropriada. O aluno aprende a fortalecer o discipulado ao compartilhar testemunhos objetivos e úteis, ajudando também seus discípulos a reconhecerem e estruturarem suas próprias histórias para edificação e evangelização.',NULL,NULL,NULL,4),(54,'Unidade 5 — A Atitude de um Mentor',NULL,5,'60 min','Devocional 5 — A Importância de Servir','Esta unidade trabalha o caráter do mentor como servo: amor, preparo, paciência, paz e propósito na missão. O aluno aprende que mentorear não é dominar pessoas, mas servir discípulos e cooperar com Deus em meio à oposição espiritual, mantendo mansidão e firmeza ao explicar o Evangelho e ao formar novos evangelistas.',NULL,NULL,NULL,4),(55,'Unidade 6 — O Foco de um Mentor',NULL,6,'60 min','Devocional 6 — Os Obstáculos do Discipulado','Nesta unidade, o aluno consolida que o alvo da Grande Comissão é fazer discípulos e não apenas convertidos. O conteúdo orienta como lidar com obstáculos ao discipulado e como conduzir acompanhamento contínuo, ensinando meios de crescimento espiritual e incentivando comunhão, serviço e perseverança para que o fruto permaneça.',NULL,NULL,NULL,4),(56,'Unidade 7 — A Missão de um Mentor',NULL,7,'60 min','Devocional 7 — Multiplicação','A unidade final firma a visão de multiplicação espiritual, chamando o mentor a reproduzir discípulos fiéis, disponíveis e ensináveis. O aluno é direcionado a praticar e avaliar a explicação do Evangelho em formato de conversa, e a assumir o compromisso de formar novas equipes, apoiar o discipulado e fortalecer a missão da igreja local.',NULL,NULL,NULL,4),(57,'Estudo 1 — Você Tem Certeza?',NULL,1,'60 min',NULL,'Esta unidade conduz o aluno a examinar, à luz das Escrituras, se é possível ter certeza da vida eterna. Por meio de perguntas de diagnóstico e textos bíblicos, o estudo confronta falsas seguranças e direciona a confiança para Cristo, levando a uma resposta pessoal clara e fundamentada.',NULL,NULL,NULL,5),(58,'Estudo 2 — Bíblia',NULL,2,'60 min',NULL,'Esta unidade apresenta a Palavra de Deus como base indispensável para o crescimento espiritual. O aluno é encorajado a ler, guardar e praticar as Escrituras com constância, entendendo que a Bíblia orienta a vida cristã e fortalece a fé por meio da obediência diária.',NULL,NULL,NULL,5),(59,'Estudo 3 — Oração',NULL,3,'60 min',NULL,'Esta unidade ensina a oração como comunhão viva com Deus — uma conversa reverente e constante que aprofunda intimidade e consolida a fé. O estudo destaca oração como adoração, confissão, gratidão e súplica, incentivando uma prática simples, perseverante e alinhada à vontade do Senhor.',NULL,NULL,NULL,5),(60,'Estudo 4 — Adoração',NULL,4,'60 min',NULL,'Esta unidade amplia a visão bíblica de adoração como mais do que momentos de culto: trata-se de uma vida inteira voltada a honrar a Deus. O aluno é chamado a glorificar o Senhor no tempo, recursos, atitudes e motivações, aprendendo a adorar em todo lugar e em todo tempo.',NULL,NULL,NULL,5),(61,'Estudo 5 — Comunhão',NULL,5,'60 min',NULL,'Esta unidade mostra que o crescimento espiritual floresce no convívio com o corpo de Cristo. Comunhão é viver em unidade, amor, cuidado e serviço dentro da família de Deus, recebendo edificação, incentivo e apoio; o aluno é encorajado a se comprometer com a vida da igreja e relacionamentos cristãos saudáveis.',NULL,NULL,NULL,5),(62,'Estudo 6 — Testemunho',NULL,6,'60 min',NULL,'Esta unidade reafirma o privilégio e a responsabilidade cristã de anunciar o Evangelho. O aluno aprende que testemunhar é comunicar as Boas Novas com clareza e coerência de vida, desenvolvendo interesse genuíno pelas pessoas e se preparando para compartilhar sua própria história e a mensagem da salvação em Cristo.',NULL,NULL,NULL,5),(63,'Estudo 7 — Direção',NULL,7,'60 min',NULL,'Esta unidade orienta o aluno a buscar e reconhecer a vontade de Deus para decisões e vida diária. O estudo enfatiza que o Senhor ama seus filhos, conduz com segurança e chama o cristão a viver sob Seu governo, aprendendo a discernir caminhos à luz das Escrituras e a seguir a direção divina com confiança e obediência.',NULL,NULL,NULL,5),(64,'Sessão 1 — Manejo da Palavra da Verdade',NULL,1,'60 min','Devocional 1 — A Palavra da Verdade','Esta unidade estabelece o fundamento do treinamento, capacitando o aluno a lidar corretamente com as Escrituras. O conteúdo reforça a importância da verdade absoluta, da confiabilidade bíblica e da preparação espiritual para responder com clareza às perguntas sinceras daqueles que questionam a fé cristã.',NULL,NULL,NULL,6),(65,'Sessão 2 — Cinco Maneiras de Lidar com uma Objeção ao Evangelho',NULL,2,'60 min','Devocional 2 — A Atitude é Tudo','Nesta unidade o aluno aprende princípios práticos para responder objeções sem confronto ou arrogância. O foco está na atitude correta do evangelista, combinando mansidão, respeito e dependência do Espírito Santo ao lidar com dúvidas, interrupções ou resistências durante conversas espirituais.',NULL,NULL,NULL,6),(66,'Sessão 3 — Eu Não Acredito na Bíblia',NULL,3,'60 min','Devocional 3 — A Confiabilidade da Bíblia','Esta unidade prepara o aluno para responder à objeção quanto à autoridade das Escrituras. O conteúdo apresenta razões históricas, arqueológicas e proféticas que demonstram a confiabilidade da Bíblia, ajudando o cristão a conduzir o diálogo de forma lógica, respeitosa e centrada no Evangelho.',NULL,NULL,NULL,6),(67,'Sessão 4 — Como Você Sabe que Deus Existe?',NULL,4,'60 min','Devocional 4 — Deus é Real','Nesta unidade o aluno aprende a apresentar respostas racionais à existência de Deus, utilizando argumentos baseados na criação, ordem, design e consciência humana. O objetivo é demonstrar que a fé cristã não é irracional, mas plenamente coerente com a realidade observável.',NULL,NULL,NULL,6),(68,'Sessão 5 — Como Deus Pode Permitir o Mal?',NULL,5,'60 min','Devocional 5 — A Perfeita Justiça de Deus','Esta unidade aborda uma das objeções mais sensíveis ao cristianismo: o problema do sofrimento, do mal e do inferno. O aluno aprende a explicar a justiça e o amor de Deus de forma equilibrada, mostrando que o mal é consequência da queda humana e que Deus oferece redenção, esperança e justiça final.',NULL,NULL,NULL,6),(69,'Sessão 6 — Como Jesus Pode Ser o Único Caminho?',NULL,6,'60 min','Devocional 6 — Um Só Caminho','Nesta unidade o aluno é capacitado a responder à exclusividade de Cristo com clareza bíblica. O conteúdo apresenta Jesus como o único Salvador por causa do pecado, do sacrifício e da ressurreição, fortalecendo a convicção cristã diante do pluralismo religioso.',NULL,NULL,NULL,6),(70,'Sessão 7 — E Quanto àqueles que Nunca Ouviram?',NULL,7,'60 min','Devocional 7 — A Criação Anuncia a Deus','A unidade final responde às objeções relacionadas à justiça divina diante dos que nunca ouviram o Evangelho e ao tema da hipocrisia religiosa. O aluno compreende a revelação de Deus por meio da criação, da consciência e de Cristo, e é desafiado a assumir responsabilidade pessoal na missão.',NULL,NULL,NULL,6),(71,'Unidade Introdutória — Orientações do Treinamento Esperança para Crianças',NULL,1,'30 min',NULL,'Esta unidade introdutória apresenta a visão, os objetivos e a estrutura do treinamento Esperança para Crianças. O facilitador é orientado quanto ao propósito evangelístico do ministério, ao papel da equipe, à importância da oração e ao preparo espiritual necessário para conduzir crianças ao conhecimento do Evangelho.',NULL,NULL,NULL,7),(72,'Unidade 1 — Olimpíadas Bíblicas',NULL,2,'60 min',NULL,'Esta unidade utiliza atividades lúdicas para ensinar verdades bíblicas fundamentais às crianças. Por meio de jogos, versículos e dinâmicas, elas aprendem que a Palavra de Deus é verdadeira, confiável e poderosa, criando um ambiente alegre e propício para o aprendizado espiritual.',NULL,NULL,NULL,7),(73,'Unidade 2 — A Entrevista',NULL,3,'30 min',NULL,'Nesta unidade o facilitador aprende a conduzir entrevistas espirituais com crianças, utilizando perguntas simples para identificar o nível de compreensão do Evangelho. O foco está em ouvir com atenção, estabelecer vínculo e discernir a condição espiritual de cada criança.',NULL,NULL,NULL,7),(74,'Unidade 3 — O Caminho do Evangelho',NULL,4,'40 min',NULL,'Esta unidade apresenta o Caminho do Evangelho por meio de gestos e explicações visuais, ajudando as crianças a memorizar e compreender os principais pontos da mensagem da salvação. O método facilita a explicação clara e progressiva do Evangelho.',NULL,NULL,NULL,7),(75,'Unidade 4 — As Boas Novas',NULL,5,'40 min',NULL,'Nesta unidade as crianças aprendem quem é Jesus e o que Ele fez para oferecer a vida eterna. O ensino enfatiza a morte e a ressurreição de Cristo, apresentando as Boas Novas de forma simples, bíblica e adequada à compreensão infantil.',NULL,NULL,NULL,7),(76,'Unidade 5 — Vamos Conversar',NULL,6,'40 min',NULL,'Esta unidade ensina como iniciar conversas espirituais e compartilhar o testemunho pessoal. As crianças aprendem a fazer perguntas, ouvir com respeito e identificar oportunidades naturais para falar sobre Deus.',NULL,NULL,NULL,7),(77,'Unidade 6 — Céu',NULL,7,'40 min',NULL,'Nesta unidade é ensinado que a vida eterna é um presente gratuito de Deus. As crianças aprendem o conceito bíblico da graça, compreendendo que o Céu não pode ser conquistado por boas obras, mas recebido pela fé.',NULL,NULL,NULL,7),(78,'Unidade 7 — Pecado',NULL,8,'40 min',NULL,'Esta unidade aborda a realidade do pecado de forma clara e apropriada para crianças. O ensino mostra que o pecado separa o ser humano de Deus e que todos necessitam do perdão oferecido por meio de Jesus Cristo.',NULL,NULL,NULL,7),(79,'Unidade 8 — Deus',NULL,9,'40 min',NULL,'Nesta unidade as crianças aprendem sobre o caráter de Deus, destacando Seu amor e Sua justiça. O ensino mostra que Deus deseja restaurar o relacionamento com as pessoas e oferece salvação por meio de Seu amor.',NULL,NULL,NULL,7),(80,'Unidade 9 — Cristo',NULL,10,'40 min',NULL,'Esta unidade ensina que Jesus é o Filho de Deus, que viveu sem pecado, morreu na cruz e ressuscitou. As crianças compreendem que somente Cristo pode perdoar pecados e conceder a vida eterna.',NULL,NULL,NULL,7),(81,'Unidade 10 — Fé',NULL,11,'40 min',NULL,'Nesta unidade é explicado o verdadeiro significado da fé bíblica, ensinando que confiar em Jesus é depender somente dEle para a salvação, e não de boas ações ou comportamento.',NULL,NULL,NULL,7),(82,'Unidade 11 — Resposta',NULL,12,'40 min',NULL,'Esta unidade orienta como conduzir uma criança a responder ao Evangelho com clareza e respeito. O foco está em apresentar o convite à fé, reconhecendo que a decisão é uma obra do Espírito Santo.',NULL,NULL,NULL,7),(83,'Unidade 12 — Crescendo em Cristo',NULL,13,'40 min',NULL,'A unidade final ensina princípios básicos de crescimento cristão, como oração, leitura bíblica, comunhão e testemunho. As crianças são encorajadas a viver diariamente sua fé e a continuar firmes em Jesus.',NULL,NULL,NULL,7),(84,'Unidade de Implementação — Implantação do Ministério Esperança para Crianças',NULL,14,'60 min',NULL,'Esta unidade orienta a implementação do ministério Esperança para Crianças na igreja local. O conteúdo aborda planejamento, formação de equipe, envolvimento da liderança, acompanhamento espiritual e continuidade do trabalho evangelístico infantil.',NULL,NULL,NULL,7),(85,'Unidade 1 — Olimpíadas Bíblicas',NULL,1,'60 min',NULL,'Esta unidade inaugura o treinamento de forma dinâmica, usando jogos e atividades para fixar os versículos-chave do Caminho do Evangelho. O objetivo é que as crianças compreendam que a Palavra de Deus é verdadeira e poderosa, criando um ambiente alegre e memorável para iniciar o aprendizado do Evangelho.',NULL,NULL,NULL,8),(86,'Unidade 2 — A Entrevista',NULL,2,'60 min',NULL,'Nesta unidade, o professor e os líderes aprendem a conhecer melhor cada criança e avaliar sua compreensão espiritual. A entrevista cria vínculo, promove escuta cuidadosa e permite discernir necessidades, preparando o caminho para ensinar o Evangelho com clareza e sensibilidade.',NULL,NULL,NULL,8),(87,'Unidade 3 — O Caminho do Evangelho',NULL,3,'60 min',NULL,'Esta unidade introduz o Caminho do Evangelho como trilho seguro para explicar a salvação de modo progressivo. As crianças aprendem a recitar com gestos os seis pontos, compreendendo que boas informações guiam ao destino correto, assim como o Evangelho guia ao Céu.',NULL,NULL,NULL,8),(88,'Unidade 4 — As Boas Novas',NULL,4,'60 min',NULL,'Nesta unidade, as crianças aprendem quem é Jesus e o que Ele fez para oferecer a vida eterna. O foco é comunicar o núcleo do Evangelho de forma simples e bíblica, incentivar o compartilhamento com outras pessoas e ensinar como oferecer oportunidade de resposta com respeito e clareza.',NULL,NULL,NULL,8),(89,'Unidade 5 — Vamos Conversar',NULL,5,'60 min',NULL,'Esta unidade treina as crianças a iniciar conversas espirituais com naturalidade, compartilhar sua história (testemunho) e usar perguntas de diagnóstico para entender em que a pessoa confia. O conteúdo reforça postura respeitosa e ajuda a conduzir o diálogo para o Evangelho sem constrangimento.',NULL,NULL,NULL,8),(90,'Unidade 6 — Céu',NULL,6,'60 min',NULL,'Nesta unidade, as crianças entendem o conceito bíblico de graça e aprendem que o Céu (vida eterna) é presente de Deus, não conquistado nem merecido. Por ilustrações e textos bíblicos, elas são encorajadas a confiar somente em Jesus e a explicar o ponto “Céu” com clareza.',NULL,NULL,NULL,8),(91,'Unidade 7 — Pecado',NULL,7,'60 min',NULL,'Esta unidade ensina o que é pecado, por que todos pecam e como o pecado separa o ser humano de Deus. As crianças aprendem a explicar o ponto “Pecado” de maneira adequada, entendendo a necessidade de salvação e preparando o terreno para compreender a obra de Cristo.',NULL,NULL,NULL,8),(92,'Unidade 8 — Deus',NULL,8,'60 min',NULL,'Nesta unidade, as crianças aprendem quem Deus é, enfatizando Seu amor e Sua justiça. O conteúdo fortalece a compreensão de que Deus é santo e correto, e que Seu amor não anula Sua justiça, preparando uma visão equilibrada do Evangelho.',NULL,NULL,NULL,8),(93,'Unidade 9 — Cristo',NULL,9,'60 min',NULL,'Esta unidade apresenta Jesus Cristo como o centro do Evangelho: Deus que veio ao mundo, viveu sem pecado, morreu em nosso lugar e ressuscitou. As crianças aprendem a explicar a obra de Cristo como a única provisão suficiente para o perdão e a vida eterna.',NULL,NULL,NULL,8),(94,'Unidade 10 — Fé',NULL,10,'60 min',NULL,'Nesta unidade, as crianças compreendem o significado de fé bíblica: confiar em Jesus, e não em esforço próprio, religiosidade ou boas obras. O objetivo é que elas saibam explicar o ponto “Fé” com simplicidade e segurança, chamando o ouvinte a depender de Cristo.',NULL,NULL,NULL,8),(95,'Unidade 11 — Resposta',NULL,11,'60 min',NULL,'Esta unidade orienta como dar oportunidade para a pessoa responder ao Evangelho, com perguntas claras e postura respeitosa. As crianças aprendem que a decisão não é pressionada, mas apresentada com amor, reconhecendo que o Espírito Santo é quem convence o coração.',NULL,NULL,NULL,8),(96,'Unidade 12 — Crescendo em Jesus',NULL,12,'60 min',NULL,'A unidade final consolida o discipulado básico, ensinando práticas essenciais para crescer em Jesus: leitura da Bíblia, oração, comunhão e testemunho. O foco é ajudar as crianças a perseverarem na fé e a continuarem compartilhando o Evangelho como estilo de vida.',NULL,NULL,NULL,8);
