 Janelas do Céu | TEACHER=John Carlos Harmon Junior | LEGACY_STATUS=3 | CONTACT_EMAIL=jharmon@eeworks.org | CONTACT_PHONE=11963890161 | COMMENT=https://forms.gle/ymntpDd1EbeNsc998  Evento promovido pelo Instituto Bíblico de Evangelização e com apoio do EE Brasil.  Esse treinamento será das 14hs as 19h30.  O treinamento foi na parte da tarde, e tivemos a participação somente das pessoas da igrejas.  Foi feito uma divulgação maior, mas tinha outros eventos acontecendo tambem no mesmo dia.  Mas, a prioridade era somente para aquela igreja.  dos 16 participantes, pelo fato que foi um feriado, a orientação no futuro fazer em uma data que não seria feriado, tinha o pastor da igreja participando e ficou bem animado, até no domingo a noite compartilhou com a igreja.  O treinamento foi de 50,00 por pessoa e gerando uma entrada para o ee de 60% no valor de R$ 480,00 | LEGACY_LESSONPLAN_ID=4 | LEGACY_ZONE_ID=11',3,30,'{\"legacy_source\": \"eebra780_main.trainings.date\", \"legacy_primary_event_date\": \"2024-11-02\"}',NULL,NULL,'2024-10-08 22:35:30','2024-11-19 15:08:22',2,800,296),(236,NULL,'John Carlos Harmon Junior',NULL,'98986056984','dslibe@yahoo.com.br','Rua Getúlio Vargas','213',NULL,'Vila Celeste','Santa Luzia de Paruá',NULL,'65272000',NULL,'98986056984',0.00,0.00,0.00,NULL,NULL,0,'EVENT_DATE=2024-11-15 | COURSE=Evangelho Em Sua Mão | CHURCH=Igreja Bíblica Alvorada | TEACHER=John Carlos Harmon Junior | LEGACY_STATUS=3 | CONTACT_EMAIL=dslibe@yahoo.com.br | CONTACT_PHONE=98986056984 | COMMENT=Evento promovido pelo Instituto Bíblico de Evangelização com apoio do EE Brasil.  Tivemos uma participação de 33 participantes nesse evento, sendo 3 igrejas,  3 pastores e 1 cacique.  As duas igrejas os pastores foram de alunos do Instituto e já tinham feito a clinica classica e tambem o workshop em 2011 comigo.  A terceira igreja, é uma igreja indígena, da etnia Ka\'apor, tendo a participação do pastor missionário da Missão Novas Tribos, e tambem o cacique da aldeia.   O mais interessante que no domingo na EBD na aldeia, o missionário e o cacique traduziram os 5 pontos do evangelho na lingua deles, e compartilhou com a Igreja.   As despesas de viagens foi paga por mim e uma parte pela igreja de lá.  Pelo fato de ser uma igreja missionária e mas não ter condição de pagar por completo.  O workshop foi no valor de R$ 45,00 por pessoa e sendo depositado 60% R$ 891,00 | LEGACY_LESSONPLAN_ID=4 | LEGACY_ZONE_ID=9',3,30,'{\"legacy_source\": \"eebra780_main.trainings.date\", \"legacy_primary_event_date\": \"2024-11-15\"}',NULL,NULL,'2024-10-08 22:52:31','2024-11-19 15:24:36',2,800,297),(237,NULL,'John Carlos Harmon Junior',NULL,'18991057528','jharmon@eeworks.org','Rua Paraiso','1738',NULL,'Boa Vista','Araçatuba',NULL,'16047160',NULL,'18991057528',0.00,0.00,0.00,NULL,NULL,0,'EVENT_DATE=2025-08-11 | COURSE=Evangelismo Eficaz | CHURCH=Instituto Bíblico de Evangelização | TEACHER=John Carlos Harmon Junior | LEGACY_STATUS=4 | CONTACT_EMAIL=jharmon@eeworks.org | CONTACT_PHONE=18991057528 | LEGACY_LESSONPLAN_ID=2 | LEGACY_ZONE_ID=25',2,30,'{\"legacy_source\": \"eebra780_main.trainings.date\", \"legacy_primary_event_date\": \"2025-08-11\"}',NULL,NULL,'2024-10-08 23:02:14','2025-07-07 17:10:47',1,800,298),(238,NULL,'Jailton Barreto Rangel',NULL,'21967349359','revgabrielst@gmail.com','Rua Réia','145',NULL,'Parque do Carmo','Duque de Caxias',NULL,'25041110',NULL,'21967349359',0.00,0.00,0.00,NULL,NULL,0,'EVENT_DATE=2025-02-14 | COURSE=Evangelho Em Sua Mão | CHURCH=Igreja Presbiteriana do Parque do Carmo | TEACHER=Jailton Barreto Rangel | LEGACY_STATUS=4 | CONTACT_EMAIL=revgabrielst@gmail.com | CONTACT_PHONE=21967349359 | LEGACY_LESSONPLAN_ID=11 | LEGACY_ZONE_ID=18',2,30,'{\"legacy_source\": \"eebra780_main.trainings.date\", \"legacy_primary_event_date\": \"2025-02-14\"}',NULL,NULL,'2024-10-09 21:42:51','2025-01-03 03:17:41',2,2,299),(239,NULL,'Jailton Barreto Rangel',NULL,'21967349359','revgabrielst@gmail.com','Rua Réia','145',NULL,'Parque do Carmo','Duque de Cax