,'2024-12-13 00:10:11','2025-09-01 20:18:44',2,1,113),(265,NULL,'Cleiton dos Santos',NULL,'21972765535','csilva@eeworks.org','Rua Marquês de Caxias','125',NULL,'Centro','Niterói',NULL,'24030050',NULL,'21972765535',130.00,0.00,0.00,NULL,NULL,0,'EVENT_DATE=2025-03-29 | COURSE=Evangelismo Eficaz | CHURCH=Assembleia de Deus Ministério IDE | TEACHER=Cleiton dos Santos | LEGACY_STATUS=3 | CONTACT_EMAIL=csilva@eeworks.org | CONTACT_PHONE=21972765535 | COMMENT=A Assembleia de Deus Ministério IDE tem demonstrado compromisso com a obra evangelística ao participar ativamente das atividades propostas pelo programa de treinamento do Evangelismo Explosivo (EE).nnNo ano de 2024, a igreja realizou um workshop inicial, voltado à capacitação e mobilização de seus membros para o evangelismo pessoal. Como continuidade desse processo, a igreja participou da Clínica (E²), ocorrida nos dias 29 e 30 de março, com foco na formação prática de líderes evangelistas.nnDurante a Clínica, 04 líderes da igreja foram treinados, recebendo capacitação específica para a apresentação clara e eficaz do evangelho. Como fruto direto desse treinamento, 08 pessoas tiveram a oportunidade de ouvir a mensagem do evangelho, sendo que 02 delas tomaram a decisão de entregar suas vidas a Jesus Cristo.nnEste resultado evidencia não apenas o empenho da igreja em cumprir a Grande Comissão, mas também a eficácia da metodologia utilizada, que tem alcançado corações e transformado vidas para a glória de Deus.nnA Assembleia de Deus Ministério IDE segue, assim, firmando seu compromisso com a evangelização pessoal e o discipulado, sendo instrumento do Reino de Deus em sua comunidade. | LEGACY_LESSONPLAN_ID=7 | LEGACY_ZONE_ID=18',3,30,'{\"legacy_source\": \"eebra780_main.trainings.date\", \"legacy_primary_event_date\": \"2025-03-29\"}',NULL,NULL,'2024-12-13 23:39:19','2025-04-13 01:00:09',1,1,277),(266,NULL,'Brasilino Pires',NULL,'22974044920','adaabrigo@gmail.com','Rua N','y',NULL,'nono','São Pedro da Aldeia',NULL,'2894000